# Define a function to generate the dates
    def generate_dates(start_date, periods, freq):
        date_list = [start_date + pd.offsets.DateOffset(freq=freq)]
        for _ in range(1, periods):
            date_list.append(date_list[-1] + pd.offsets.DateOffset(freq=freq))
        return pd.DatetimeIndex(date_list)

    # Generate the sales data
    sales_df = pd.DataFrame({
        'Date': generate_dates(start_date, periods, freq),
        'Category': ['Electronics'] * periods,
        'Sales': np.random.randint(100, 2000, size=periods),
    })
    sales_df['Category'].iloc[-1] = 'Fashion'
    sales_df['Sales'].iloc[-1] = np.random.randint(100, 2000, size=1)
    sales_df.set_index('Date', inplace=True)
